export default function ReportImage() {
    return (
        <div>
            <div class="card my-3">
                <figure class="text-center my-2">
                    <img style={{ "width": "90%" }} src="http://baochinhphu.vn/Uploaded/buithuhuong/2021_02_17/kham%20benh.jpg" alt="Image" />
                    <p class="my-2" style={{ "font-size": "10x", "font-weight":"bold" }}>Figure. Some image</p>
                </figure>
            </div>
        </div>
    );
}
